import { useEffect, useState } from "react";
const Users = () => {
    let[User,setUser]=useState([])
    useEffect(()=>{
        let fetchdata=async()=>{
            let response=await fetch('http://localhost:4000/user')
            let data=await response.json()
            setUser(data)
        }
        fetchdata()
    },[User])
    return ( 
        <div className="users">
            <h1>Users List</h1>
            <div className="user1">
                {User.map((data)=>(
                    <div className="userdetails">
                        <h4>User {data.id}</h4>
                        <p>{data.firstName}</p>
                        <p>{data.lastName}</p>
                        <p>{data.email}</p>
                        <p>{data.phone}</p>
                    </div>
                ))}
            </div>
        </div>
     );
}
 
export default Users;
